create table contest_result
(
    id                  bigint                             not null
        primary key,
    userId              bigint                             not null comment '创建用户id',
    contestId           bigint                             not null comment '比赛id',
    contestExerciseData text                               null comment '比赛做题信息（json）',
    submitStatus        int                                null comment '提交状态',
    createTime          datetime default CURRENT_TIMESTAMP null comment '创建时间',
    updateTime          datetime default CURRENT_TIMESTAMP null comment '更新时间',
    isDelete            int      default 0                 null comment '是否逻辑删除'
);

create index idx_userId
    on contest_result (userId);

